DROP TABLE IF EXISTS Administration;

CREATE TABLE Administration (
  User varchar(40) DEFAULT NULL,
  Password varchar(40) DEFAULT NULL,
  UsageLevel varchar(40) DEFAULT NULL,
  KEY Administration_User_idx (User)
) ENGINE=MyISAM DEFAULT CHARSET=latin1;


DROP TABLE IF EXISTS AtomCounts;

CREATE TABLE AtomCounts (
  AtomCountKey varchar(40) NOT NULL,
  Molecule varchar(100) DEFAULT NULL,
  AtomSymbol varchar(10) DEFAULT NULL,
  AtomCount smallint(6) DEFAULT NULL,
  PRIMARY KEY (AtomCountKey)
) ENGINE=MyISAM DEFAULT CHARSET=latin1;


DROP TABLE IF EXISTS AuthorTag;

CREATE TABLE AuthorTag (
  Author varchar(50) NOT NULL,
  Information varchar(1000) DEFAULT NULL,
  PRIMARY KEY (Author)
) ENGINE=MyISAM DEFAULT CHARSET=latin1;


DROP TABLE IF EXISTS CMLStructures;

CREATE TABLE CMLStructures (
  ElementName varchar(40) NOT NULL,
  CMLStructure varchar(2000) DEFAULT NULL,
  PRIMARY KEY (ElementName)
) ENGINE=MyISAM DEFAULT CHARSET=latin1;


DROP TABLE IF EXISTS DatabaseMolecule;

CREATE TABLE DatabaseMolecule (
  Molecule varchar(100) NOT NULL,
  Source varchar(100) DEFAULT NULL,
  CMLStructure varchar(3000) DEFAULT NULL,
  PRIMARY KEY (Molecule)
) ENGINE=MyISAM DEFAULT CHARSET=latin1;


DROP TABLE IF EXISTS DisassociationEnergy;

CREATE TABLE DisassociationEnergy (
  DisassociationEnergy double DEFAULT '0',
  Error double DEFAULT '0',
  ElementName varchar(100) DEFAULT NULL,
  Source varchar(100) DEFAULT NULL
) ENGINE=MyISAM DEFAULT CHARSET=latin1;


DROP TABLE IF EXISTS GroupElement;

CREATE TABLE GroupElement (
  CenterAtom varchar(8) DEFAULT NULL,
  ConnectingAtom varchar(8) DEFAULT NULL,
  Count smallint(6) DEFAULT '1',
  ElementName varchar(40) DEFAULT NULL,
  ConnectElementName varchar(40) NOT NULL,
  PRIMARY KEY (ConnectElementName)
) ENGINE=MyISAM DEFAULT CHARSET=latin1;


DROP TABLE IF EXISTS GroupStandardEnthalpy;

CREATE TABLE GroupStandardEnthalpy (
  ElementName varchar(40) NOT NULL,
  StandardEnthalpy double DEFAULT '0',
  Reference varchar(40) DEFAULT 'none',
  Time timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,
  PRIMARY KEY (ElementName)
) ENGINE=MyISAM DEFAULT CHARSET=latin1;


DROP TABLE IF EXISTS GroupStandardEntropy;

CREATE TABLE GroupStandardEntropy (
  ElementName varchar(40) NOT NULL,
  Reference varchar(50) DEFAULT 'none',
  Time timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,
  StandardEntropy double DEFAULT '0',
  PRIMARY KEY (ElementName)
) ENGINE=MyISAM DEFAULT CHARSET=latin1;


DROP TABLE IF EXISTS HeatCapacityElement;

CREATE TABLE HeatCapacityElement (
  Temperature double DEFAULT '0',
  HeatCapacity double DEFAULT '0',
  Reference varchar(40) DEFAULT 'none',
  Time timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,
  ElementName varchar(40) DEFAULT NULL
) ENGINE=MyISAM DEFAULT CHARSET=latin1;


DROP TABLE IF EXISTS MetaAtomInfo;

CREATE TABLE MetaAtomInfo (
  MetaAtomKey varchar(40) NOT NULL,
  MetaAtomType varchar(40) DEFAULT NULL,
  MetaAtomName varchar(40) DEFAULT NULL,
  ElementName varchar(40) DEFAULT NULL,
  PRIMARY KEY (MetaAtomKey)
) ENGINE=MyISAM DEFAULT CHARSET=latin1;


DROP TABLE IF EXISTS Molecule;

CREATE TABLE Molecule (
  ElementName varchar(50) NOT NULL,
  Source varchar(100) DEFAULT NULL,
  CMLStructure varchar(2000) DEFAULT NULL,
  PRIMARY KEY (ElementName)
) ENGINE=MyISAM DEFAULT CHARSET=latin1;


DROP TABLE IF EXISTS NameListSet;

CREATE TABLE NameListSet (
  GroupName varchar(40) DEFAULT NULL,
  Name varchar(40) DEFAULT NULL
) ENGINE=MyISAM DEFAULT CHARSET=latin1;


DROP TABLE IF EXISTS ReferenceTag;

CREATE TABLE ReferenceTag (
  ReferenceName varchar(50) NOT NULL,
  Author varchar(40) DEFAULT 'none',
  Source varchar(40) DEFAULT 'none',
  PRIMARY KEY (ReferenceName)
) ENGINE=MyISAM DEFAULT CHARSET=latin1;


DROP TABLE IF EXISTS SourceTag;

CREATE TABLE SourceTag (
  Source varchar(40) NOT NULL,
  Information varchar(1000) DEFAULT NULL,
  PRIMARY KEY (Source)
) ENGINE=MyISAM DEFAULT CHARSET=latin1;


DROP TABLE IF EXISTS StructureAtom;

CREATE TABLE StructureAtom (
  StructureAtomName varchar(50) NOT NULL,
  ElementName varchar(40) DEFAULT NULL,
  AtomIndex varchar(20) DEFAULT NULL,
  AtomType varchar(20) DEFAULT NULL,
  PRIMARY KEY (StructureAtomName)
) ENGINE=MyISAM DEFAULT CHARSET=latin1;


DROP TABLE IF EXISTS StructureBond;

CREATE TABLE StructureBond (
  StructureBondName varchar(60) NOT NULL,
  ElementName varchar(40) DEFAULT NULL,
  Atom1 varchar(20) DEFAULT NULL,
  Atom2 varchar(20) DEFAULT NULL,
  Type varchar(20) DEFAULT NULL,
  PRIMARY KEY (StructureBondName)
) ENGINE=MyISAM DEFAULT CHARSET=latin1;


DROP TABLE IF EXISTS StructureType;

CREATE TABLE StructureType (
  KeyName varchar(50) NOT NULL DEFAULT 'none',
  ElementName varchar(40) DEFAULT NULL,
  StructureType varchar(40) DEFAULT NULL,
  PRIMARY KEY (KeyName)
) ENGINE=MyISAM DEFAULT CHARSET=latin1;


DROP TABLE IF EXISTS SymmetryDefinition;

CREATE TABLE SymmetryDefinition (
  SymmetryName varchar(40) NOT NULL,
  ElementName varchar(40) DEFAULT NULL,
  SymmetryType varchar(40) DEFAULT NULL,
  SymmetryFactor double DEFAULT '1',
  PRIMARY KEY (SymmetryName)
) ENGINE=MyISAM DEFAULT CHARSET=latin1;


DROP TABLE IF EXISTS SymmetryPairAssignments;

CREATE TABLE SymmetryPairAssignments (
  SymmetryName varchar(40) DEFAULT NULL,
  GroupName varchar(20) DEFAULT NULL,
  AtomId varchar(20) DEFAULT NULL,
  ConnectedSymmetry varchar(10) DEFAULT 'N'
) ENGINE=MyISAM DEFAULT CHARSET=latin1;


DROP TABLE IF EXISTS VibrationalStructures;

CREATE TABLE VibrationalStructures (
  ElementName varchar(50) NOT NULL,
  StructureName varchar(50) DEFAULT NULL,
  Frequency float DEFAULT NULL,
  Symmetry int(11) DEFAULT NULL,
  PRIMARY KEY (ElementName)
) ENGINE=MyISAM DEFAULT CHARSET=latin1;


